import Logo from '../../../Assets/Logo/logo.png'

class HeaderLogo extends React.Component {
  render() {
    return (
      <div className="Navbar__Link logo__position">
       <Link to="/upload">
        <img className="logo--size" src={Logo} alt="" />
        </Link>
      </div>

    )
  }
}

export default HeaderLogo;
